    Kenny Marchant and Michael Burgess both made contributions to our party. The contributions
    are noted on Line 11(c). This was not a transfer (line 11c) or a reimbursement
    (line 15).                                                                                                 2.
    Administrator's Salary is shown 100% on Line 21(b) under the name 'Branch 558'.
    Our software (FEC Ver. 6.1.1.3) does not allow us to access Line 30(b).                      3.
    Our software was not able to access Schedule H4 on the original report. After
    a 45 minute conversation with FEC tech support, and reinstallation of the software,
    we now can. See amended Schedule H4.                                                                         4.
    More description is entered for fund raising expenses. Note that the current software
    allows only 40 spaces for a description. Fund raising was for purposes of raising
    funds for the party, not for any candidate.                                                       5.
    No portion of any fund raising expenses were for separately identified federal
    candidates. Therefore, no expenses are disclosed on Lines 23, 24, or 25."
